import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer'

const customers=[
  {
  'rank':'1',
  'image':'https://placeimg.com/64/64/1',
   'name':'짜장 ',
   'table':'3',
   'time':'4'
  },
  {
    'rank':'2',
    'image':'https://placeimg.com/64/64/2',
     'name':'짬뽕',
     'table':'4',
     'time':'5'
  }
]


class App extends Component {
  render() {
    return (
      <div>
        {
          customers.map(c=>{
            return(
              <Customer
              rank={c.rank}
              image={c.image}
              name={c.name}
              table={c.table}
              time={c.time}

              />

            )
          })



        }
      </div> 
    );
  }
}

export default App;
